<script>
	import CapitalPoint from '$lib/maps/CapitalPoint.svelte';

	export let selectedId;

	const startPositions = [
		{ x: 335, y: 285 },
		{ x: 385, y: 296 },
		{ x: 350, y: 315 }
	];

	function drawCurvedLine(targetPoint) {
		const canvas = document.getElementById('arrow-canvas');
		const ctx = canvas.getContext('2d');

		if (ctx && targetPoint) {
			const canvasRect = canvas.getBoundingClientRect();
			const canvasPosition = {
				x: canvasRect.left,
				y: canvasRect.top
			};

			const targetPointRect = targetPoint.getBoundingClientRect();

			const startX = startPositions[selectedId].x;
			const startY = startPositions[selectedId].y;

			const finalX = targetPointRect.left - canvasPosition.x;
			const finalY = targetPointRect.top - canvasPosition.y;

			ctx.clearRect(0, 0, canvas.width, canvas.height);
			ctx.beginPath();
			ctx.setLineDash([4, 2]);
			ctx.moveTo(startX, startY);

			const controlPointX = (startX + finalX) / 2;
			const controlPointY = Math.min(startY, finalY) - 50;
			ctx.quadraticCurveTo(controlPointX, controlPointY, finalX, finalY);

			ctx.strokeStyle = 'white';
			ctx.lineWidth = 2;
			ctx.stroke();
			ctx.closePath();
		}
	}
</script>

